from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    subject = ""
    for triple in triples:
        if not subject:
            subject = triple.subject
            sentence += f"{subject} "

        if triple.predicate == "cityServed":
            sentence += f"serves the city of {triple.object}. "
        elif triple.predicate == "country":
            sentence += f"is in {triple.object}. "
        elif triple.predicate == "capital":
            sentence += f"has {triple.object} as its capital. "
        else:
            if len(triples) > 1:
                if triple == triples[0]:
                    sentence += f"has a {triple.predicate} of {triple.object}. "
                else:
                    sentence += f"and has a {triple.predicate} of {triple.object}. "
            else:
                sentence += f"has a {triple.predicate} of {triple.object}. "

    return sentence

